import React from "react";
import "./CardVertical.css";

const CardVertical = ()=>{
    return (
        <div className="cardVerticalContainer">
            <div className="imageAndReview">
                <img src="https://www.twopeasandtheirpod.com/wp-content/uploads/2021/03/Veggie-Pizza-8-650x974.jpg" alt="" />
                <div className="review">
                 <i class="fas fa-star"></i> <span>4.5</span>
                </div>
            </div>
            <div className="titleAndSubtitle">
                <h1>Vegetable Pizza</h1>
                <h2>Whit Extra sauce</h2>
            </div>
            <div className="priceAndIconAdd">
                <span>$10.5</span>
                <button className="add"><i class="fas fa-plus"></i></button>
            </div>
        </div>
    )
}
export default CardVertical;
